import axios from "axios";
import GET_ITEMS from "../actionType";

const getItems = async (props) => {
  await axios(
    "https://run.mocky.io/v3/9d71cb03-a9f9-4d70-bae2-9d3adaa1cfe7",
    {}
  )
    .then((res) => {
      console.log(props.name, res.data);
      return {
        type: GET_ITEMS,
        payload: res.data,
      };
    })
    .catch((error) => {
      // console.log(error);
      return {
        type: GET_ITEMS,
        payload: "something wentwrong",
      };
    });
};
export default getItems;
